import React, { Component } from 'react';

class Generes extends Component {
    state = {  }
    render() { 
        return (
            <ul className="list-group">
                {this.props.items.map(item => <li onClick={()=>{this.props.onSelect(item)}} className="list-group-item">{item.name}</li>)}
            </ul>
        );
    }
}
 
export default Generes;
